const Basket = () => {
    const items = [
        { name: 'T-shirt', price: 20 },
        { name: 'Pull', price: 30 },
        { name: 'Pantalon', price: 40 },
    ];

    const total = items.reduce((acc, item) => acc + item.price, 0);

    return (
        <div>
            {items.map((item, index) => (
                <div key={index}>
                    <h2>{item.name}</h2>
                    <p>Prix: {item.price}€</p>
                </div>
            ))}
            <h2>Total: {total}€</h2>
        </div>
    );
};

export default Basket;
